(110,1,"2019-10-22 17:51:47","2019-10-22 17:51:47","<h4>OTHERS CALL IT A CLASS,</h4>		\n			<h4>WE CALL IT A PARTY</h4>		\n		<p>Leave your troubles at the door and get lost in a workout that melts your stress and lifts your spirits.</p>		\n			<a href=\"#\" role=\"button\">\n						LEARN ABOUT CLASSES\n					</a>\n			<h2>It\'s time to work it out </h2>		\n		<p>FitFlex\'s Top skilled trainers will get you in shape. Reach the perfect fit with the outfit you\'ve always wanted</p>		\n			<a href=\"#\" role=\"button\">\n						count me in\n					</a>\n			<figure><img width=\"143\" height=\"143\" src=\"http://vasa.local/wp-content/uploads/2019/10/22.png\" alt=\"\" /></figure><h3>Foot work</h3><p>Walking, running, climbing. Your feet will be put to the test.</p>		\n			<figure><img width=\"143\" height=\"143\" src=\"http://vasa.local/wp-content/uploads/2019/10/21.png\" alt=\"\" /></figure><h3>Heart rate</h3><p>The fastest way to reach results is to monitor the progress you make.</p>		\n			<figure><img width=\"143\" height=\"143\" src=\"http://vasa.local/wp-content/uploads/2019/10/20.png\" alt=\"\" /></figure><h3>Weight lifting</h3><p>By slowly raising the weight bar, we are able to built muscles safely.</p>		\n			<h3>What Our customers say</h3>		\n										<img width=\"204\" height=\"204\" src=\"http://vasa.local/wp-content/uploads/2019/10/1.jpg\" alt=\"\" srcset=\"http://vasa.local/wp-content/uploads/2019/10/1.jpg 204w, http://vasa.local/wp-content/uploads/2019/10/1-150x150.jpg 150w\" sizes=\"(max-width: 204px) 100vw, 204px\" />											\n				<p>\n					I\'ve managed to stay with  FitFlex 3 times a week, for over 6 months now, and I owe it all to the classes that make you fall in love with the process.\n				</p>\n								<p>Lizzie Thompson</p>\n										<img width=\"204\" height=\"204\" src=\"http://vasa.local/wp-content/uploads/2019/10/2.jpg\" alt=\"\" srcset=\"http://vasa.local/wp-content/uploads/2019/10/2.jpg 204w, http://vasa.local/wp-content/uploads/2019/10/2-150x150.jpg 